import mealsImg from '../../assets/meals.jpg';
import '../../css/home'
const CardContainer=()=> {

    return (
        <div className="full-container-fluid">
              <img className={`${classes.homeImg} img-fluid`} src={mealsImg} alt="A table full of delicious food" />
        </div>
    )
}

export default React.memo(CardContainer);
